import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet,Image, Text, View ,ImageBackground, Button, Alert, Modal } from 'react-native';
import { createNativeWrapper } from 'react-native-gesture-handler';


export default function App() {
  const image={uri:"https://reactjs.org/logo-og.png"};
  const image2={uri:"https://reactnative.dev/docs/assets/p_cat2.png"};

  // const imagesrc2={"Aquaman.jpg"};
  return (
    <View style={[styles.container, {flexDirection: "column"}]}>
    {/* <ImageBackground source={require('./Aquaman.jpg')} resizeMode="cover" style={styles.image}> */}
    <ImageBackground source={image} resizeMode="cover" style={styles.image}>

      <View style={styles.container}>
        <StatusBar 
          animated={true}
          backgroundColor="skyblue"></StatusBar>

          <Text style={[styles.text,{top:"50%",}]}>Open up App.js to start working on your app!</Text>
          <View >
            <Button title="hello" onPress={() => Alert.alert('Button pressed')} style={styles.button}></Button>
          </View>
          {/* <Modal style={styles.modal}>
            <Text style={styles.text}>Yo Yo Bitches!</Text> 
          </Modal> */}
          </View>
          <View style={[styles.bigbox,{left:10,top:"1%",},]}>
            <Image source={{uri:"https://img.icons8.com/clouds/200/000000/adobe-flash.png"}}  style={{ width: 200, height:230 }} ></Image>
          </View>
      <View style={[styles.lowerContainor,{flexDirection: "row",}]}>
      {/* <View style={styles.lowerContainor}> */}
        <View style={[styles.box,{backgroundColor:"#000000"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/cute-clipart/50/000000/instagram-new.png"}} 
          style={{ width: 30, height:30 }} ></Image>
          <Button style={styles.button2} title="Instagram" color="#000000" onPress={()=> Alert.alert("Insta")}></Button>
        </View>
        <View style={[styles.box,{backgroundColor:"#000000"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/cute-clipart/64/000000/facebook-new.png"}} 
          style={{ width: 30, height:30 }} 
          onProgress={()=> Alert.alert("wow bitch")} ></Image>
          <Button style={{ width: 30, height: 30 }} title="Facebook" color="#000000" disabled></Button>
        </View>
        <View style={[styles.box,{backgroundColor:"#000000"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/cute-clipart/64/000000/linkedin.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="LinkedIn" color="#000000" ></Button>
        </View>
        <View style={[styles.box,{backgroundColor:"#000000"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/cute-clipart/64/000000/twitter.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="Twitter" color="#000000" ></Button>
        </View>
        <View style={[styles.box,{backgroundColor:"#000000"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/cute-clipart/64/000000/reddit.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="reddit" color="#000000" ></Button>
        </View>
        {/* <View style={[{backgroundColor:"#000000"},{flexDirection: "row",}]}>
          <Image source={{uri:"https://img.icons8.com/ios/50/000000/delete--v3.png"}} style={{ width: 30, height:30 }}></Image>
          <Button style={{ width: 30, height: 30 }} title="Talk" color="#000000" ></Button>
        </View> */}
        </View>
      {/* </View> */}
      </ImageBackground>

    </View>


  );
}

const styles = StyleSheet.create({
  basecontainer:{
    flex: 1,
    // backgroundColor: 'skyblue', 
    backgroundColor:"white",
    alignItems: 'center',
    // justifyContent: 'center',
  },
  container: {
    flex:2,
    alignItems: 'center',
    // justifyContent: "space-around",
  },
  lowerContainor:{
    flex:1,
    position: "absolute",
    bottom:7,
    // top:1000,
    left:0,
    right:0,
    alignSelf:"stretch",
    // justifyContent: "space-around",
    alignItems:"center",
  },
  bigbox:{
    height:200,
    width:200,
  },
  box:{
    height:50,
    width:100,
  },
  image: {
    flex: 1,
    color:"skyblue",
    alignSelf:"stretch",
    justifyContent: "center"
  },
  button:{
    alignSelf:"center",
    fontSize:40,
    color:"white",
    // height:"100%",
  },
  button2:{
    // backgroundColor:"#dc143c",
    color:"white",
    alignSelf:"center",
    backgroundColor:"skyblue"
    // height:"100%",
  },
  text:{
    color: "white",
    fontSize: 30,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000"
  },
  modal:{
    color:"#f0f8ff",
    backgroundColor:"#f0f8ff",
    justifyContent:'center',
    alignSelf:"center",
  },
});
